import React from 'react';

const TooManyRequests = () => {
    return (
        <div>
            Our Servers have responded with Too Many Requests. Unfortunately you cannot use Project-Share Website now, but check again in a few minutes. 
            <button onClick={() => window.close()}>Close Tab</button>
        </div>
    )
}

export default TooManyRequests;
